webpackJsonp([0x9651a7e52c1d],{794:function(t,e){t.exports={data:{markdownRemark:{html:'<p>Congratulations on deciding to set up your hacker-powered security program on HackerOne! Here are the steps that\'ll get you up and running:</p>\n<ol>\n<li>Go to hackerone.com.</li>\n<li>Click <strong>Sign Up</strong>.</li>\n<li>Fill out all fields on the form.</li>\n<li>Click <strong>Create Program</strong>.</li>\n<li>A confirmation email will be sent asking you to confirm your email address. Go to your email and click <strong>Confirm email address</strong>.</li>\n<li>You\'ll be taken to a page where you can select the type of program you\'d like to launch. You can choose from:</li>\n</ol>\n<table>\n<thead>\n<tr>\n<th>Option</th>\n<th>Detail</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>HackerOne Response</td>\n<td>A private vulnerability disclosure program for organizations to receive and resolve security vulnerability reports from external third parties.</td>\n</tr>\n<tr>\n<td>HackerOne Bounty</td>\n<td>A continuous security program in which trusted hackers are incentivized to find critical vulnerabilities.</td>\n</tr>\n</tbody>\n</table>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-3ec16.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.3831123517097%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="getting-started-1"\n        title=""\n        src="/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-2f183.png"\n        srcset="/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-67829.png 125w,\n/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-5c59f.png 250w,\n/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-2f183.png 500w,\n/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-c93e8.png 750w,\n/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-4e628.png 1000w,\n/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-b3ac4.png 1500w,\n/static/getting-started-1-d8ee59cdc1a4fc115d6b69ecb9ded37f-3ec16.png 2866w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Next Steps</h3>\n<ul>\n<li><a href="start-h1-response.html">Start HackerOne Response</a> or <a href="start-h1-bounty.html">Start HackerOne Bounty</a>.</li>\n<li><a href="https://support.hackerone.com/hc/en-us/requests/new">Contact HackerOne</a> to work with one of our program managers to get guidance on setting up your program.</li>\n</ul>',frontmatter:{path:"/programs/program-start-up-guide.html",id:"programs/program-start-up-guide",title:"Program Start-Up Guide",description:null}}},pathContext:{}}}});
